import React from "react";
import "./index.css";

const Navbar = () => {
  return (
    <>
      <nav className="navbar navbar-dark bg-dark">
        <div className="container-fluid">
          <span className="navbar-brand mb-0 h1">Showing Pandemic Data</span>
        </div>
      </nav>
    </>
  );
};
export default Navbar;
